import React, { Component } from 'react'

import "./style.css"
class StopWatch extends Component{
    constructor(props) {
        super(props)
        this.state = {
        timerSec : 0,
        timerMin : 0
        }
      }

    render(){
        return(
            <div className = "watch">
                <h1>{this.state.timerMin}+":"+{this.state.timerSec}</h1>
            </div>
        )
    }
}
export default StopWatch
